import React from 'react';
import {Link} from 'react-router-dom';
import {NavStyle, NavContainer} from '../styled/theme';
import {useSelector} from 'react-redux';
const Navbar = () => {
	const session = useSelector( 
		state => state.session,
	);
	return(
		<NavStyle>
			<NavContainer>
				<li className="logo">
					<Link to="/">
					TravelStory
					</Link>
				</li>

				<li>
					<Link to={'/user/' + session.id} >
						My Stories
					</Link>
				</li>
				<li>Logout</li>
			</NavContainer>
		</NavStyle>);
};

export default Navbar;
